import React, { useState } from "react";
import Carusel from "./Carousel";
import BlogCards from "./BlogCards";
import blogData from "../blog.json";
const Blog = () => {
  const [blogCards, setBlogCards] = useState(blogData);
  const designCards = () => {
    setBlogCards(blogData.filter(card =>
      card.kopce === "ДИЗАЈН"
    ));
  }
  return (
    <div>
       <div className= "showCategorii" >
        <ul>
          <li>ФЛИЛТРИРАЈ</li>
          <li>СИТЕ</li>
          <li>КАРИЕРА</li>
          <li>ТЕХНОЛОГИЈА</li>
          <li>DATA SCIENCE</li>
          <li>МАРКЕТИНГ</li>
          <li>ДИЗАЈН</li>
          <li>IMPACT</li>
         <a href="https://medium.com/wearelaika/brainster-space-the-new-home-of-the-local-tech-community-in-skopje-ffe97b564152">
         <li>#SpaceFamily</li>
           </a>
        </ul>
      </div> 
      <Carusel />
      <BlogCards blogData={blogCards}/>
    </div>
  );
};

export default Blog;
